import "bootstrap/dist/js/bootstrap.min.js";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <>
      <div className="sidebar">
      <Link to="/" className="nav-link"> Telefon</Link>
        <a href="#phone">Telefon</a>
        <a href="#computer">Számítógép</a>
        <a href="#headphones">Fülhallgató</a>
        <a href="#computer-parts">Számítógép alkatrész</a>
      </div>
      {/* Other content of the page goes here */}
    </>
  );
}
